class Solution {
  int maximumNumberOfStringPairs(List<String> words) {
    Map<String, int> reverseCount = {};
    int pairs = 0;

    // Count the occurrences of each word's reverse
    for (var word in words) {
      var reversed = word.split('').reversed.join();
      reverseCount[reversed] = (reverseCount[reversed] ?? 0) + 1;
    }

    // Check each word for a possible pair
    for (var word in words) {
      if (reverseCount[word] != null && reverseCount[word]! > 0) {
        pairs++;
        reverseCount[word] = reverseCount[word]! - 1; // Decrement the count of the reverse word
      }
    }

    // Divide by 2 because each pair is counted twice
    return pairs ~/ 2;
  }
}
